import ExpensItem from './components/ExpensItem';
function App() {
  const expenses=[
    {title:'Car Insurance',amount:'$294.7',date: new Date(2023,2,28)},
    {title:'Car Insurance',amount:'$294.2',date: new Date(2022,6,21)},
    {title:'Car Insurance',amount:'$294.4',date: new Date(2023,7,2)},
  ]
  return (
    <div className=''>
          <ExpensItem  title={expenses[0].title} date={expenses[0].date} amount={expenses[0].amount}/>
          <ExpensItem  title={expenses[1].title} date={expenses[1].date} amount={expenses[1].amount}/>
          <ExpensItem  title={expenses[2].title} date={expenses[2].date} amount={expenses[2].amount}/>


    </div>
  );
}

export default App;
